import './App.min.css';
import Navbar from './components/Navbar';
import Showcase from './components/Showcase';
import Contacts from './views/Contacts';
import Home from './views/Home';

function App() {
  return (
    <>
      <Home />
      <Contacts />
      <Navbar />
      <Showcase />
    </>
  );
}

export default App;
